insert into house_bill values
(00102, "AN ACT AMENDING REPUBLIC ACT NO. 9344, AS AMENDED BY REPUBLIC ACT NO. 10630, AND REVERTING THE MINIMUM	AGE OF CRIMINAL RESPONSIBILITY FROM 15 YEARS OLD TO 9 YEARS OLD", "Transmittal to the Senate",  "2016-06-30", 1),
(00123,	"AN ACT PROMOTING CONSUMER PROTECTION ON THE PURCHASE OF MOBILE COMMUNICATION DEVICES BY ALLOWING CONSUMERS TO UNLOCK THE MOBILE WIRELESS DEVICES PRIOR TO THE EXPIRATION OF THE LOCK-IN PERIOD UNDER THE MOBILE COMMUNICATION SERVICE CONTRACT", "1st Reading",  '2017-08-13', 3),
(00001,	"AN ACT IMPOSING THE DEATH PENALTY ON CERTAIN HEINOUS CRIMES", "1st Reading",  '2017-08-13', 3),
(00003,	"AN ACT GRANTING PRESIDENT RODRIGO ROA DUTERTE, EMERGENCY POWERS TO ADDRESS THE MASSIVE TRAFFIC CONGESTION IN THE COUNTRY THAT HAS ASSUMED THE NATURE AND MAGNITUDE OF A NATIONAL EMERGENCY, DECLARING A NATIONAL POLICY IN CONNECTION THEREWITH AND AUTHORIZING HIM, FOR A LIMITED PERIOD AND SUBJECT TO RESTRICTIONS, TO IMPLEMENT RULES AND REGULATIONS NECESSARY AND PROPER TO CARRY OUT SUCH POWERS", "2nd Reading",  '2017-08-13', 3),
(00004,	"AN ACT CREATING CIRCUIT CRIMINAL COURTS GRANTING THEM EXCLUSIVE ORIGINAL JURISDICTION TO TRY AND DECIDE CERTAIN CRIMINAL CASES, AMENDING BATAS PAMBANSA BILANG 129, AS AMENDED, OTHERWISE KNOWN AS THE JUDICIARY REORGANIZATION ACT OF 1980, APPROPRIATING FUNDS THEREFOR AND FOR OTHER PURPOSES", "2nd Reading", '2017-08-13', 3),
(00005,	"AN ACT PROVIDING FOR STIFFER PENALTIES FOR PERSONS DRIVING UNDER THE INFLUENCE OF ALCOHOL, DANGEROUS DRUGS AND SIMILAR SUBSTANCES, AMENDING FOR THE PURPOSES REPUBLIC ACT NO. 10586, OTHERWISE KNOWN AS THE 'ANTI-DRUNK AND DRUGGED DRIVING ACT OF 2013'", "2nd Reading", '2017-08-13', 3),
(00006,	"AN ACT ENHANCING PUBLIC SAFETY AT THE LOCAL LEVEL BY ESTABLISHING AND MAINTAINING A DEPARTMENT OF PUBLIC SAFETY IN EVERY PROVINCE, CITY AND MUNICIPALITY", "2nd Reading", '2017-08-13',3),
(00007,	"AN ACT NAMING THE LAOAG BY-PASS ROAD AS THE RODOLFO G. FARINAS JR. HIGHWAY", "2nd Reading", '2017-08-13', 3),
(00008,	"AN ACT INSTITUTIONALIZING A CRIMINAL INVESTIGATION SYSTEM, REPEALING FOR THE PURPOSE REPUBLIC ACT NO. 5180, ENTITLED 'AN ACT PRESCRIBING A UNIFORM SYSTEM OF PRELIMINARY INVESTIGATION BY PROVINCIAL AND CITY FISCALS AND THEIR ASSISTANTS AND BY STATE ATTORNEYS OR THEIR ASSISTANTS,' AS AMENDED", "2nd Reading", '2017-08-13',3),
(00009,	"AN ACT PROVIDING FOR THE ESTABLISHMENT OF A DRUG REHABILITATION CENTER IN EVERY REGION AND APPROPRIATING FUNDS THEREFOR", "3rd Reading",'2017-08-13', 3),
(00010,	"AN ACT ESTABLISHING JUVENILE JUSTICE COURTS, GRANTING THEM EXCLUSIVE ORIGINAL JURISDICTION OVER CRIMINAL CASES INVOLVING YOUTHFUL OFFENDERS, AMENDING FOR THE PURPOSE BATAS PAMBANSA BILANG 129, AS AMENDED, OTHERWISE KNOWN AS THE JUDICIARY REORGANIZATION ACT OF 1980, APPROPRIATING FUNDS THEREFOR AND FOR OTHER PURPOSES", "3rd Reading", '2017-08-13', 3),
(00011,	"AN ACT MODIFYING THE COMPENSATION AND POSITION CLASSIFICATION SYSTEM OF CIVILIAN GOVERNMENT PERSONNEL AND THE BASE PAY SCHEDULE OF MILITARY AND UNIFORMED PERSONNEL IN THE GOVERNMENT, AND FOR OTHER PURPOSES", "3rd Reading", '2017-08-13', 3),
(00012,	"AN ACT ESTABLISHING THE FILIPINO IDENTIFICATION SYSTEM", "3rd Reading", '2017-08-13', 3),
(00013,	"AN ACT PROVIDING FOR THE SPECIAL PROTECTION OF CHILDREN IN SITUATIONS OF ARMED CONFLICT AND PROVIDING PENALTIES FOR VIOLATIONS THEREOF", "1st Reading",  '2017-08-13', 3),
